import React from "react";
import { Link } from "react-router-dom";
import Header from "../components/Header";
import propTypes from "prop-types";

export default class Home extends React.Component {
  state = {
    info: [],
  };

  componentDidMount() {
    this.getLocalStorage();
  }

  getLocalStorage = () => {

    const {
      location: {
        state: { userName },
      },func
    } = this.props;
    const {location: { state: { user } } } = this.props;
    if(userName){
    func(userName) 
    const userNameStrg = JSON.parse(localStorage.getItem(userName));
    this.setState({ info: userNameStrg })}
    else{
    func(user) 
    const userNameStrg = JSON.parse(localStorage.getItem(user));
    this.setState({ info: userNameStrg })
    }
  }

  render() {
    const {
      newUser
    } = this.props;
    const {info} = this.state;
    return (
      <div>
          <Header user={newUser} />
        <div> 
          <div>
          <img src={info.foto} alt={info.name}/> 
          <p>{info.userName}</p>
          </div>
        <form>

        </form>
        </div>
      </div>
    );
  }
}

Home.propTypes = {
  location: propTypes.shape({
    state: propTypes.shape({
      cartProducts1: propTypes.oneOfType([propTypes.array]),
    }),
  }),
}.isRequired;
